import React, {Component} from 'react';
import Search from './CardNew';

class GitDescription extends Component {
  render() {
    return (<div>
      <div className="search">
        <input type="search" name="Search" id="search" placeholder="TYPE GIT COMMANDS HERE" autoCorrect="off" autoCapitalize="off" spellCheck="false"></input>
      </div>
      <div className="container-fluid git-card">
        <Search/>
      </div>
    </div>);
  }
}

export default GitDescription;
